import React from 'react';
import './styles/PostsContainerPostsView.css'

const PostsContainer = ({ posts, headers }) => {
    console.log(posts)
    return (
        <div className="PostsContainerPostsView">
            <div className="PostsContainerPostsView-header">
                {
                    headers.map((field, keyIndex) => (
                        <div className="PostsContainerPostsView-header-field" key={keyIndex}>
                            { field }
                        </div>
                    ))
                }
            </div>
            { 
                posts.map((post, postIndex) => {
                    return (
                        <div className="PostsContainerPostsView-post" key={postIndex}>
                            {
                                headers.map((field, keyIndex) => (
                                    <div className="PostsContainerPostsView-post-field PostsContainerPostsView-post-field-long" key={keyIndex}>
                                        { post[field] }
                                    </div>
                                ))
                            }
                        </div>
                    )
                })
            }
        </div>
    );
}

export default PostsContainer;
